import React from "react";
import { AiOutlineDelete } from "react-icons/ai";
import { BiEdit } from "react-icons/bi";
import { useDispatch } from "react-redux";

const Todo = ({ todo }) => {
  const dispatch = useDispatch();
  return (
    <ul>
      <li className="task" onClick={() => dispatch.toggle}>
        <span>{todo.data}</span>
        <span className="icon">
          <AiOutlineDelete />
        </span>
        <span className="icon">
          <BiEdit />
        </span>
      </li>
    </ul>
  );
};

export default Todo;
